9	Trng hp 1: Thng bo thay i c ng l nh u t nc ngoi	1	Ni dung\r\n\r\nThng bo thay i c ng l nh u t nc ngoi trong cng ty c phn cha nim yt (theo quy nh ti khon 3 iu 31 lut doanh nghip)\r\n\r\nA. Thnh phn h s:\r\n1. Thng bo thay i ni dung ng k doanh nghip do ngi i din theo php lut ca doanh nghip k;\r\n2. Danh sch c ng l nh u t nc ngoi sau khi  thay i.\r\nDanh sch c ng l nh u t nc ngoi phi bao gm ch k ca c ng c gi tr c phn thay i, khng bt buc phi c ch k ca c ng c gi tr c phn khng thay i;\r\n3. Hp ng chuyn nhng c phn hoc cc giy t chng minh vic hon tt chuyn nhng;\r\n4. Bn sao giy t php l ca c nhn trong trng hp ngi nhn chuyn nhng l c nhn; bn sao giy t php l ca t chc, bn sao giy t php l ca c nhn i vi ngi i din theo y quyn v bn sao vn bn c ngi i din theo y quyn trong trng hp ngi nhn chuyn nhng l t chc.\r\ni vi c ng l t chc nc ngoi th bn sao giy t php l ca t chc phi c hp php ha lnh s;\r\n5. Vn bn ca C quan ng k u t chp thun v vic gp vn, mua c phn, mua phn vn gp ca nh u t nc ngoi, t chc kinh t c vn u t nc ngoi i vi trng hp phi thc hin th tc ng k gp vn, mua c phn, mua phn vn gp theo quy nh ca Lut u t.\r\n\r\nBiu mu:\r\n\r\n-  DANH SCH C NG L NH U T NC NGOI\r\n\r\n-  HP NG CHUYN NHNG\r\n\r\n- Ph lc II-1 THNG BO THAY I NI DUNG NG K DOANH NGHIP	3
10	Trng hp 2: Thng bo thay i ngnh, ngh kinh doanh ca cng ty c phn	2	Ni dung\r\n\r\n1. Thng bo thay i ni dung ng k doanh nghip do ngi i din theo php lut ca doanh nghip k;\r\n2. Ngh quyt, quyt nh v bn sao bin bn hp ca i hi ng c ng i vi cng ty c phn v vic thay i ngnh, ngh kinh doanh.\r\n\r\nBiu mu:\r\n\r\n- BIN BN HP THAY I CA I HI NG C NG\r\n\r\n- QUYT NH THAY I CA I HI NG C NG\r\n\r\n- Ph lc II-1 THNG BO THAY I NI DUNG NG K DOANH NGHIP	3
11	Trng hp 3: Thng bo thay i ni dung ng k thu	3	Ni dung\r\n\r\n1. Thng bo thay i ni dung ng k doanh nghip do ngi i din theo php lut ca doanh nghip k.\r\n\r\nBiu mu:\r\n\r\nPh lc II-1 THNG BO THAY I NI DUNG NG K DOANH NGHIP	3
12	Trng hp 4: Thng bo thay i thng tin ca c ng sng lp	4	Ni dung\r\n\r\nThng bo thay i thng tin ca c ng sng lp cng ty c phn cha nim yt trong trng hp c ng sng lp cha thanh ton hoc ch thanh ton mt phn s c phn  ng k (theo quy nh ti iu 113 Lut Doanh nghip)\r\nA. Thnh phn h s:\r\n1. Thng bo thay i ni dung ng k doanh nghip do ngi i din theo php lut ca doanh nghip k;\r\n2. Danh sch c ng sng lp cng ty c phn, trong  khng bao gm thng tin v c ng sng lp cha thanh ton s c phn  ng k mua.\r\n\r\nBiu mu:\r\n\r\n- Ph lc I-7 DANH SCH C NG SNG LP CNG TY C PHN\r\n\r\n- Ph lc II-1 THNG BO THAY I NI DUNG NG K DOANH NGHIP	3
13	Trng hp 5: Thay i thng tin c ng l nh u t nc ngoi, thng tin ngi i din theo y quyn ca c ng l nh u t nc ngoi	5	Ni dung\r\n\r\nThng bo thay i thng tin c ng l nh u t nc ngoi, thng bo thay i thng tin ngi i din theo y quyn ca c ng l nh u t nc ngoi (theo quy nh ti khon 3 iu 176 Lut Doanh nghip)\r\nA. Thnh phn h s:\r\n\r\n1. Thng bo v vic b sung, cp nht thng tin ng k doanh nghip.\r\n\r\nBiu mu: Ph lc II-5 THNG BO V VIC B SUNG CP NHT THNG TIN NG K DOANH NGHIP	3
14	ng k tm ngng kinh doanh i vi doanh nghip	1	Ni dung\r\n\r\n1. Thng bo tm ngng kinh doanh.\r\n2. Ngh quyt, quyt nh v bn sao bin bn hp ca Hi ng qun tr i vi cng ty c phn v vic tm ngng kinh doanh.\r\n\r\nBiu mu:\r\n\r\n- Ph lc II-19 THNG BO V VIC TM NGNG KINH DOANH - TIIP TC KINH DOANH TRC THI HN  THNG BO\r\n\r\n- BIN BN HP TM NGNG KINH DOANH CA HI NG QUN TR\r\n\r\n- QUYT NH TM NGNG KINH DOANH CA HI NG QUN TR	4
15	ng k tip tc kinh doanh trc thi hn  thng bo doanh nghip	2	Ni dung\r\n\r\nThng bo tip tc kinh doanh trc thi hn  thng bo.\r\n\r\nBiu mu: Ph lc II-19 THNG BO V VIC TM NGNG KINH DOANH - TIIP TC KINH DOANH TRC THI HN  THNG BO	4
16	ng k gii th doanh nghip	1	Ni dung\r\n\r\nng k gii th doanh nghip (trng hp quy nh ti cc im a, b v c khon 1 iu 207 Lut Doanh nghip)\r\nBc 1: Thng bo tnh trng doanh nghip ang lm th tc gii th trn Cng thng tin quc gia v ng k doanh nghip\r\nA. Thnh phn h s:\r\n1. Thng bo v gii th doanh nghip;\r\n2. Ngh quyt, quyt nh v bn sao bin bn hp ca i hi ng c ng i vi cng ty c phn v vic gii th doanh nghip;\r\n3. Phng n gii quyt n (nu c).\r\n\r\n* Doanh nghip lu : Sau khi thng tin doanh nghip trong C s d liu quc gia v ng k doanh nghip sang tnh trng ang lm th tc gii th: Doanh nghip thc hin th tc hon thnh ngha v thu vi C quan thu theo quy nh ca Lut Qun l thu.\r\n\r\nBiu mu:\r\n\r\n- Ph lc II-22 THNG BO V VIC GII TH DOANH NGHIP\r\n\r\n- BIN BN HP GII TH CA I HI NG C NG\r\n\r\n- QUYT NH GII TH CA I HI NG C NG\r\n\r\n \r\n\r\nBc 2: Np h s ng k gii th doanh nghip\r\nA. Thnh phn h s:\r\n1. Thng bo v gii th doanh nghip (theo mu quy nh);\r\n2. Bo co thanh l ti sn doanh nghip; danh sch ch n v s n  thanh ton, gm c thanh ton ht cc khon n v thu v n tin ng bo him x hi, bo him y t, bo him tht nghip cho ngi lao ng sau khi quyt nh gii th doanh nghip (nu c).\r\n\r\n(Doanh nghip lu : i vi doanh nghip s dng con du do c quan cng an cp, doanh nghip c trch nhim tr con du, Giy chng nhn  ng k mu con du cho c quan cng an theo quy nh khi lm th tc gii th.)\r\n\r\nBiu mu: Ph lc II-22 THNG BO V VIC GII TH DOANH NGHIP	5
17	Hy b ngh quyt, quyt nh gii th doanh nghip	2	Ni dung\r\n\r\n1. Thng bo v vic hy b ngh quyt, quyt nh gii th\r\n2. Ngh quyt, quyt nh v bn sao bin bn hp ca i hi ng c ng i vi cng ty c phn v vic hy b ngh quyt, quyt nh gii th doanh nghip\r\n\r\nBiu mu: Ph lc II-23 THNG BO V VIC HY B NGH QUYT QUYT NH GII TH DOANH NGHIP	5
18	Np h s	1	Cch thc thc hin:\r\n\r\nNgi thnh lp doanh nghip hoc doanh nghip hoc ngi c y quyn thc hin th tc ng k doanh nghip theo phng thc sau y:\r\na) ng k doanh nghip trc tip ti Phng ng k kinh doanh;\r\nb) ng k doanh nghip qua dch v bu chnh;\r\nc) ng k doanh nghip qua mng thng tin in t ti Cng thng tin quc gia v ng k doanh nghip (https://dangkykinhdoanh.gov.vn)\r\n\r\nS lng h s: 01 b h s\r\n\r\ny quyn thc hin th tc ng k doanh nghip\r\na) Trng hp y quyn cho c nhn thc hin th tc ng k doanh nghip, km theo h s ng k doanh nghip phi c vn bn y quyn cho c nhn thc hin th tc lin quan n ng k doanh nghip v bn sao giy t php l ca c nhn c y quyn. Vn bn y quyn ny khng bt buc phi cng chng, chng thc.\r\nb) Trng hp y quyn cho t chc thc hin th tc ng k doanh nghip, km theo h s ng k doanh nghip phi c bn sao hp ng cung cp dch v vi t chc lm dch v thc hin th tc lin quan n ng k doanh nghip, giy gii thiu ca t chc  cho c nhn trc tip thc hin th tc lin quan n ng k doanh nghip v bn sao giy t php l ca c nhn ngi c gii thiu.\r\nc) Trng hp y quyn cho n v cung cp dch v bu chnh cng ch thc hin th tc ng k doanh nghip th khi thc hin th tc ng k doanh nghip, nhn vin bu chnh phi np bn sao phiu gi h s theo mu do doanh nghip cung ng dch v bu chnh cng ch pht hnh c ch k xc nhn ca nhn vin bu chnh v ngi c thm quyn k vn bn  ngh ng k doanh nghip.\r\nd) Trng hp y quyn cho n v cung cp dch v bu chnh khng phi l bu chnh cng ch thc hin th tc ng k doanh nghip, km theo h s ng k doanh nghip phi c bn sao hp ng cung cp dch v vi t chc lm dch v thc hin th tc lin quan n ng k doanh nghip, giy gii thiu ca t chc  cho c nhn trc tip thc hin th tc lin quan n ng k doanh nghip v bn sao giy t php l ca c nhn ngi c gii thiu.\r\n \r\n\r\nThi hn gii quyt:\r\n\r\nTrong thi hn 03 ngy lm vic k t ngy nhn h s, C quan ng k kinh doanh c trch nhim xem xt tnh hp l ca h s ng k doanh nghip v cp ng k doanh nghip; trng hp h s cha hp l, C quan ng k kinh doanh phi thng bo bng vn bn ni dung cn sa i, b sung cho ngi thnh lp doanh nghip. Trng hp t chi ng k doanh nghip th phi thng bo bng vn bn cho ngi thnh lp doanh nghip v nu r l do.	6
